    self.onResize();
}

self.onResize = function() {
    if(self.ctx.$scope.threedSimulationWidget)
        self.ctx.$scope.threedSimulationWidget.onResize(self.ctx.width, self.ctx.height);  
}

self.onEditModeChanged = function () {
   self.ctx.$scope.threedSimulationWidget.onEditModeChanged();
}

self.onDataUpdated = function() {
    self.ctx.$scope.threedSimulationWidget.onDataUpdate();
}

self.onDestroy = function() { }

